import { ListGroup } from "react-bootstrap";

const ArtistList = (props) => {

  const {artists ,selectedArtistsCB } = props

  return (
    <div className="main">
      <h2>Artists list</h2>

      <div >
        {artists.map((a) => (
          <ListGroup.Item key={a.id}
          onClick={selectedArtistsCB}  active
          >{a.name}</ListGroup.Item>
        ))}
      </div>
    </div>
  );
};

export default ArtistList;
